interface Obj {
  type: string;
  payload: string;
  param: string;
}

const addTeam = (team: string, param: string): Obj => {
  return {
    type: 'ADD_Team',
    payload: team,
    param: window.location.pathname,
  };
};
const removeTeam = (id: string): Obj => {
  return {
    type: 'REMOVE_Team',
    payload: id,
    param: window.location.pathname,
  };
};

export default {
  addTeam,
  removeTeam,
};
